    "def preprocess_data(self, data):\n",
    "    \"\"\"Preprocess dataset with detailed reporting and filtering for high accuracy.\"\"\"\n",
    "    print(\"\\nüîß Preprocessing data...\")\n",
    "    \n",
    "    # Handle missing values\n",
    "    missing_values = data.isnull().sum()\n",
    "    if missing_values.any():\n",
    "        print(\"\\n‚ö†Ô∏è Missing values found:\")\n",
    "        print(missing_values[missing_values > 0])\n",
    "        print(\"\\nüîß Filling missing values with medians...\")\n",
    "        data.fillna(data.median(numeric_only=True), inplace=True)\n",
    "    \n",
    "    # Apply filtering based on feature ranges\n",
    "    print(\"\\nüîç Filtering data for optimal feature ranges...\")\n",
    "    filtered_data = data[\n",
    "        (data['Temperature (¬∞C)'] >= 15) & (data['Temperature (¬∞C)'] <= 35) &\n",
    "        (data['Humidity (%)'] >= 30) & (data['Humidity (%)'] <= 70) &\n",
    "        (data['Wind Speed (km/h)'] >= 5) & (data['Wind Speed (km/h)'] <= 50) &\n",
    "        (data['Precipitation (mm)'] >= 0) & (data['Precipitation (mm)'] <= 200) &\n",
    "        (data['Magnitude'] >= 2.0) & (data['Magnitude'] <= 7.0) &\n",
    "        (data['Depth (km)'] >= 5) & (data['Depth (km)'] <= 100) &\n",
    "        (data['River Level (m)'] >= 0) & (data['River Level (m)'] <= 10) &\n",
    "        (data['Soil Moisture (%)'] >= 10) & (data['Soil Moisture (%)'] <= 50) &\n",
    "        (data['Atmospheric Pressure (hPa)'] >= 950) & (data['Atmospheric Pressure (hPa)'] <= 1050)\n",
    "    ]\n",
    "    \n",
    "    print(f\"\\n‚úÖ Filtered dataset shape: {filtered_data.shape}\")\n",
    "    \n",
    "    # Select features\n",
    "    features = ['Temperature (¬∞C)', 'Humidity (%)', 'Wind Speed (km/h)', \n",
    "                'Precipitation (mm)', 'Magnitude', 'Depth (km)', \n",
    "                'River Level (m)', 'Soil Moisture (%)', 'Atmospheric Pressure (hPa)']\n",
    "    \n",
    "    X = filtered_data[features]\n",
    "    y = filtered_data['Disaster Type']\n",
